megaFreezeIT = {'0831d2'}

function megaFreeze()
	    for i=1, #megaFreezeIT, 1 do
        obj = getObjectFromGUID(megaFreezeIT[i])
		        if obj ~= nil then
			            obj.interactable = false
			            obj.tooltip = false
		        end
    	end
end

function onLoad() 
   Wait.time(
        function()    
            self.setState(1)
            megaFreeze()                        
        end,
        0.2
    )  
end

